import {Nav, Navbar, Button} from 'react-bootstrap';
import '../navigation/navigation.styles.css';

const NavBar = () => (
    <Navbar bg="primary" variant="dark">
        <h2>Online IT Software Solutions</h2>
          <Nav className="mr-auto">
            <Nav.Link className="navlink">Home</Nav.Link>
            <Nav.Link className="navlink">Courses</Nav.Link>
            <Nav.Link className="navlink">AboutUS</Nav.Link>
            <Nav.Link className="navlink">Sign up</Nav.Link>
            <Nav.Link className="navlink">Register</Nav.Link>
          </Nav>
        <Button variant="Success" className="mr-sm-2">Logout</Button>
    </Navbar>
)
export default NavBar;
